import { Link } from "react-router-dom";

const EVENTS = [
  { id: "e1", title: "event 1" },
  { id: "e2", title: "event 2" },
  { id: "e3", title: "event 3" },
];

function EventsPage() {
  <ul>
    {EVENTS.map(event => <li><Link to='event.id'></Link></li>)}
  </ul>
}

export default EventsPage
